import React from "react";

const VideoDetail = ({ title, description, avis }) => {
  let avisUtilisateur = {avis} * 10;
  return (
    <div>
      <h1>{title}</h1>
      <p>{description}</p>
      <p>{avisUtilisateur}</p>
    </div>
  );
};

export default VideoDetail;
